"use strict";function getJSON(){fetch("groceries.json").then(function(n){return n.json()}).then(function(n){var e="";n.forEach(function(n){e+='\n        <li class="grid-item">\n          <article class="card">\n            <div class="card-header">\n              <span class="card-qty">Qty: '.concat(n.qty,'</span>\n            </div>\n            <div class="card-body">\n              <h2 class="card-title">').concat(n.item,'</h2>\n              <span class="card-brand">').concat(n.brand,'</span>\n              <span class="card-type">').concat(n.type,'</span>\n            </div>\n            <div class="card-footer">\n              <span class="card-category">').concat(n.category,"</span>\n            </div>\n          </article>\n        </li>\n        ")}),document.getElementById("output").innerHTML=e}).catch(function(){var n=document.createElement("div");n.className="error",n.appendChild(document.createTextNode("Data Not Found"));var e=document.querySelector(".container"),t=document.querySelector(".grid");e.insertBefore(n,t)})}document.addEventListener("DOMContentLoaded",getJSON);